import React from "react";
import ReactDOM from "react-dom";



import animals from './data';

const [cat, dog] = animals;

let {name, sound} = cat;
let {dogName, dogSound} = dog;

ReactDOM.render(
  <table>
  <tbody>
  <tr>
    <td>{cat}</td>
    <td>{dog}</td>
  </tr>
  <tr>
    <td>
      {catName}
    </td>
    <td>
      {dogName}
    </td>
  </tr>
  <tr>
    <td>
      {catSound}
    </td>
    <td>
      {dogSound}
    </td>
  </tr>

  </tbody>

  </table>
  ,
  document.getElementById("root")
)

